import { HeaderElements } from "./header/HeaderElements"
import brand from '../img/brand.png';

export const Header = ()=>{

    <i class="fas fa-shopping-cart">Cart</i>;
    <i class="fas fa-utensils">Menu</i>;
    <i class="fas fa-phone">pgonr</i>



    let sections = [ 'Количка', 'Начало', 'МЕНЮ', 'За нас', '0876 442 740', '0878 222 317', 'priateli@abv.bg'];

    return (
        <section className="header">
            <nav className="navBar">
                <ul className='navUl'>
                    <li className='navItem'>
                        <a className="brand" href="#" />
                        <img src={brand} alt='logo' />
                    </li>
                    {sections.map(x => <HeaderElements key={x} name={x} />)}
                </ul>
            </nav>
        </section>
    )
}
